    ws_array = np.array(df_wr["ws"].unique(), dtype=float)

    wd_grid, ws_grid = np.meshgrid(wd_array, ws_array, indexing="ij")
    freq_interp = NearestNDInterpolator(df_wr[["wd", "ws"]], df_wr["freq_val"])
    freq = freq_interp(wd_grid, ws_grid)

